}))(TableCell);

const StyledTableRow = withStyles((theme) => ({
  root: {
    "&:nth-of-type(odd)": {
      backgroundColor: theme.palette.action.hover,
    },
  },
  wrow: {
    width: "555px",
  },
}))(TableRow);

const useStyles = makeStyles({
  table: {
    minWidth: 700,
    marginTop: 30,
    maxWidth: 400,
    marginLeft: 300,
  },
  icons: {
    width: 33,
    cursor: "pointer",
