                                    <StyledTableCell className={classes.wrow} align="center">{dados}</StyledTableCell>
                                    <StyledTableCell className={classes.wrow} align="right">{dados}</StyledTableCell>
                                </StyledTableRow>
                            ))} */}
                </TableBody>
              </Table>
            </TableContainer>
          </Container>
        </Paper>
      </>
    );
  }
}

export default Estoque;
